import React from 'react';
import IssueList from './Components/issuesList';
import IssuePage from './Components/issuePage';

import './App.css';

function App() {
  return (
    <div className="App">
      <h4>Hello from App</h4>
      <IssueList></IssueList>
      <IssuePage></IssuePage>
    </div>
  );
}

export default App;
